1	Description du Workflow / Processus Métier\nUn workflow, ou processus métier, est une représentation visuelle et structurée des étapes\nnécessaires pour accomplir une tâche ou un objectif spécifique au sein d'une organisation. Il\ndécrit comment les tâches sont réalisées, qui en est responsable, quelles données ou\ndocuments sont échangés, et quelles sont les décisions clés à chaque étape.\nDans le contexte de la Direction de l'Exécution Budgétaire, le workflow permet de modéliser\net d’optimiser les processus critiques tels que :\n\n\nLa gestion des engagements budgétaires : depuis la réception des demandes jusqu'à\nleur validation.\n\n\n\nLe traitement des factures : contrôle, validation et paiement.\n\n\n\nL’intégration avec les outils informatiques : comme Odoo, Oracle ou Coriolis, pour\nautomatiser les flux de données et réduire les erreurs.\n\nLe but de ce questionnaire est de collecter les informations nécessaires pour :\n1. Cartographier les étapes actuelles des processus.\n2. Identifier les points de blocage et les opportunités d’amélioration.\n3. Modéliser un workflow clair et efficace qui s’intègre aux outils existants et respecte les\ncontraintes métiers et réglementaires.\nUn workflow bien conçu améliore la transparence, la traçabilité et l’efficacité opérationnelle,\ntout en garantissant que chaque étape respecte les délais et les normes établis.\n\nCe questionnaire est structuré pour couvrir tous les aspects pertinents pour une cartographie et\nune optimisation des processus.\n\nQuestionnaire	2
2	Section 1 : Informations Générales\n1. Nom de la Direction:\n2. Nom et fonction du répondant :\n3. Coordonnées (email, téléphone):\n\nSection 2 : Description des Processus Actuels\n1. Quels sont les principaux processus métiers de la Direction de l’Exécution Budgétaire ?\no\n\nExemples : validation budgétaire, traitement des factures, suivi des dépenses.\n\n2. Quels sont les documents ou données utilisés à chaque étape des processus ?\n\n3. Quels sont les systèmes ou logiciels actuellement utilisés pour ces processus ?\no\n\nExemples: Odoo, Coriolis, Oracle.\n\n4. Quels sont les points de contrôle ou de validation critiques dans les processus ?\n\n5. Quelles sont les parties prenantes internes et externes impliquées dans les processus ?\no\n\nExemples : services internes, fournisseurs, direction générale.	3
3	Section 3 : Analyse des Flux de Travaux (Workflows)\n1. Comment démarre chaque processus (déclencheur) ?\no\n\nExemples : réception d’une demande, approbation d’un supérieur.\n\n2. Quels sont les flux d’informations ou de documents entre les différentes étapes ?\no\n\nPapier, numérique, systèmes intégrés?\n\n3. Quels sont les outils ou moyens utilisés pour transmettre les informations ou\ndocuments ?\n\n4. Quels sont les délais moyens pour chaque étape ?\n\n5. Existe-t-il des goulots d’étranglement ou des retards fréquents dans les processus ?\n\n6. Y a-t-il des processus redondants ou manuels qui pourraient être automatisés ?	4
4	7. Comment les workflows sont-ils suivis et supervisés actuellement ?\n\nSection 4 : Evaluation des Applications Utilisées\n1. Quels logiciels ou applications sont utilisés pour gérer les processus métiers ?\no\n\nExemple : Odoo pour la gestion des documents, Oracle pour le budget, Coriolis\npour les finances.\n\n2. Ces logiciels couvrent-ils tous vos besoins ? Si non, quelles fonctionnalités manquent ?\n\n3. Y a-t-il des intégrations entre ces logiciels ? Si oui, lesquelles?\n\n4. Quels sont les principaux problèmes rencontrés avec ces outils ?\n\n5. Quel niveau de formation les utilisateurs ont-ils sur ces outils ?\n\n6. Souhaitez-vous des améliorations ou des remplacements pour ces logiciels ?\no\n\nSi oui, précisez les besoins spécifiques.	5
5	Section 5: Améliorations et Suggestions\n1. Quels sont les principaux objectifs d’amélioration pour les processus métiers ?\no\n\nExemples : réduction des délais, amélioration de la transparence, automatisation.\n\n2. Quels processus nécessitent une refonte complète ? Pourquoi?\n\n3. Quelles fonctionnalités ou outils souhaiteriez-vous ajouter pour optimiser les workflows ?\n\n4. Y a-t-il des réglementations spécifiques à prendre en compte dans la modélisation des\nprocessus ?\n\n5. Souhaitez-vous intégrer de nouvelles technologies ou systèmes (ex. automatisation,\nintelligence artificielle) ?\n\nSection 6: Données Techniques	6
6	1. Quels formats de données sont manipulés dans les processus (Excel, PDF, papier, etc.)\n?\n\n2. Quels sont les besoins en matière de sécurité des données (confidentialité, accès\nrestreint) ?\n\n3. Y a-t-il des contraintes d’infrastructure technique (serveurs, réseaux, etc.) ?\n\nSection 7: Validation\n1. Qui valide les différentes étapes des processus métiers ?\no\n\nNiveaux hiérarchiques, rôles.\n\n2. Quels documents ou données sont nécessaires pour chaque validation ?\n\n3. Quels sont les délais standard pour valider une étape du workflow ?	7
7	Section 8: Annexes\n1. Pouvez-vous fournir des diagrammes ou des descriptions des workflows actuels ?\n2. Avez-vous des guides ou des manuels d’utilisation des logiciels utilisés ?\n3. Y a-t-il des rapports d’audit ou des évaluations disponibles pour consultation ?	8
